
#include<bits/stdc++.h>
using namespace std;

//Approach 1: TC O(n^2), SC O(1)
void removeStars1(string &s) {
    for (int i = 0; i < s.size() ; ) 
    {
        if (s[i] == '*')
        {
            s.erase(i, 2);
            i--;
        } 
        else 
            i++;
        
    }
}
//Approach 2: TC O(n), SC O(n)
string removeStars2(string s) {
    string ans;
    for (int i = 0; i < s.size(); i++)
    {
        if (s[i] == '*')
            ans.pop_back();
        else
            ans += s[i];
    }
    return ans;
}
//Approach 3: TC O(n), SC O(1)
string removeStars3(string s) {
    int j = 0;
    //do dry run eg. a*b, a*b*cd
    for (int i = 0; i < s.size(); i++)
    {
        if (s[i] == '*')
            j--;
        else
            s[j++] = s[i];
    }
    return s.substr(0,j); 
}
